import { Navigate, isAuth, Outlet } from "react-router-dom";

import { loginSelector } from "../pages/login/selectors";

import { ROUTE_NAMES } from "./routeNames";



export const PrivateRoute = () => {
    
    const { isAuth } = loginSelector((store) => store.loginPage);
    
    return isAuth ? <Outlet /> : <Navigate to={ROUTE_NAMES.LOGIN} />
  
}
